import React from 'react';

import './Table.scss';
import { Modal } from 'react-bootstrap';

export default props => {
  const {Thead, Tbody} = props;
  return (
    <div className="custom-table border table-responsive ">
      <table className="table ">
        <thead>
          {Thead}
        </thead>
        <tbody>
          {Tbody}
        </tbody>
      </table>
    </div>
  );
};
